css:
.auto-cursor {
  cursor: default;
}
kite-links {
  line-height: normal;
  display: block;
  text-align: right;
  margin-top: 10px;
}
kite-links a,
kite-links a:hover,
kite-links a:focus,
kite-links a:active {
  color: #6494ed;
  font-size: 0.9em;
}
kite-links a {
  opacity: 0.85;
}
kite-links a:hover {
  opacity: 1;
  text-decoration: underline;
}
kite-links a + a {
  margin-left: 3.33333333px;
}
kite-links kite-logo {
  width: 0.9rem;
  opacity: 0.5;
  margin-left: 1rem;
  flex-grow: 0;
  flex-shrink: 0;
  flex-basis: 0.9rem;
}
kite-links kite-logo svg polygon {
  fill: #d7dae0;
}
